node.text:
O Programa Alumni USP com o apoio da Reitoria da Universidade de São Paulo, torna público o Prêmio Alumni USP 2023, que tem como objetivo reconhecer e premiar os egressos(as) diplomados(as) da USP que se destacaram por suas contribuições nas áreas de atuação profissional, e que impactaram positivamente na sociedade.

Para participar, os(as) egressos(as) deverão ser diplomados(as) em curso de graduação ou programas de mestrado ou de doutorado da USP e observar o disposto no Regulamento do Prêmio Alumni USP

CATEGORIAS:

 - Contribuições na qualidade de vida das pessoas;
 - Contribuições nas relações humanas e inclusão social;
 - Contribuições na sustentabilidade ambiental;
 - Contribuições em inovações e empreendedorismo;
 - Contribuições em arte e cultura
 - Contribuições em ciências e tecnologia.

Saiba mais: www.alumni.usp.br/premio-alumni-usp-2023/
